message:
❗️ Обращение мэра Мариуполя Вадима Бойченко: «Мы боремся за нашу и вашу свободу»

- Город обстреливает артиллерия, по нему бьют с авиации (микрорайоны на Левом берегу, пос. Сартана);

- Есть жертвы среди мирного населения и разрушения;

- Сбит российский самолёт над городом;

- Пекарни испекли 10 тонн хлеба, доставляют воду жителям;

- Предприниматели объединились, доставляют продукты армии и в торговые сети;

- Энергоснабжения по-прежнему нет

⚡️Ранкове звернення міністра оборони Резнікова. 

Ключові тези:

- де всі ті, хто обіцяв за 2 години захопити Київ? 

- я бачу героїчну армію;

- я бачу тисячі і тисячі Громадян, які взяли до рук зброю;

- в нашу перемогу тепер віримо не тільки ми;

- темрява відступить. Світанок близько. Тримаймо стрій.

Небольшая сводка новостей на сейчас: 

⚡️у противника оперативная пауза, потому что они несут потери. В западной части Киева продолжается накопление количества противников, мы наносим по ним артиллерийский удар;

⚡️Сумы полностью под контролем Украины. ВСУ и местные жители самоорганизовались  и держат оборону;

⚡️Харьков держится и показывает блестящий результаты своей работы;

⚡️Под Мариуполь отправляется тактическая группа РФ из Мелитополя. Наши знают про эту проблему и сейчас будут встречать там российские войска;

⚡️Херсон держат наши силы и наносят потери врагу;

⚡️Российские военные массово сдаются в плен.

⚡️Информация от Генштаба:

На белорусском аэродроме Гомель совершили посадку российские Ил-76 с десантниками на борту.

Из-за повреждения взлетной полосы аэродрома Гостомель, противник решил выдвигаться своим ходом с территории Беларуси в направлении Гомель-Чернигов-Киев;

❗️Тезисно о мобилизации:

- Проводится во всех областях Украины кроме Луганской и Донецкой;
- Срок проведения: в течение 90 суток со дня вступления в силу Указа;
- Призыв военнообязанных, резервистов и т.д. осуществляется в объемах, определенных согласно мобилизационным планам;
- Главам обл.  администраций поручено обеспечить создание и работу областных, районных и городских медицинских комиссий.

⚡️ Нардеп Ярослав Железняк заявил, что работа по согласованию текста указа о чрезвычайном положении продолжается: «От Рады идёт письмо от глав фракции на Президента чтобы изменить указ. Спорные пункты должны убрать. И будет новый Указ»

Спорные пункты - это:

- осмотр граждан и имущества;
- запрет на изготовление и распространение информации;
- регулирование теле- и радиоцентров

Диалог директора СВР Нарышкина и Путина:

- Поддерживаю вхождение «Л/ДНР» в состав РФ;
- Мы это не обсуждаем;
- Я поддерживаю предложение о признании независимости.
